import React from 'react';
import { Table, Tag } from 'antd';
import { Cars } from './../../cars';

const { Column, ColumnGroup } = Table;


class Vehicles extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      data: []
    }
    this.delete = this.delete.bind(this);
  }

  componentDidMount() {
    this.setState({data: Cars.getCars()})
  }

  delete(text, record) {
    console.log('delete')
  }

  render() {
    return (
      <Table dataSource={this.state.data}>
        <ColumnGroup title="Cars">
          <Column
            title="Brand"
            dataIndex="brand"
            key="brand"
          />
          <Column
            title="Year"
            dataIndex="year"
            key="year"
          />
        </ColumnGroup>
        <Column
          title="Action"
          key="action"
          render={(text, record) => (<button onClick={this.delete.bind(this, text, record)}>Eliminar</button>)}
        />
      </Table>
    )
  }
}

export default Vehicles;
